import './App.css';
import React, { useEffect, useState } from "react";
import USAMap from "react-usa-map";
import abb from "./state_transfer";
import Data from "./data_display";
import image1 from "./images/circle.png";

function App() {
  let gpt_response = "HAIDHOWAHI";
  const [a, setA] = useState("A");
  async function callgpt(input){

    const { Configuration, OpenAIApi } = require("openai");


    const configuration = new Configuration({
    apiKey: 'process.env.REACT_APP_API_KEY',
    });
    const openai = new OpenAIApi(configuration);
    
    const msg = input;
  
    const completion = await openai.createChatCompletion({
    model: "gpt-3.5-turbo",
    messages: [{role: "user", content: msg}],
    });
  
    const response = completion.data.choices[0].message.content;
    console.log(completion.data.choices[0].message.content);
    gpt_response = response;
    const name = document.createTextNode(gpt_response);
    document.getElementById("gpt_result").appendChild(name);
  };

  const [text, setText] = useState('insert state')
  function handleClick (abbreviate) {
    setText(abb(abbreviate));
    document.getElementById('DataInfo').scrollIntoView();
    callgpt("how do cows eat");
    
  };
  const fill_color = {fill: "lightblue"};
  const fill_color1 = {fill: "green"};
  const fill_color2 = {fill: "red"};
  const statesCustomConfig = () => {
    return {
      "NJ": fill_color,
      "NY": fill_color2,
      "WY": fill_color,
      "AL": fill_color2,
      "AK": fill_color2,
      "AR": fill_color1,
      "AZ": fill_color2,
      "CA": fill_color1,
      "CO": fill_color,
      "CT": fill_color2,
      "DE": fill_color,
      "FL": fill_color1,
      "GA": fill_color2,
      "HI": fill_color1,
      "ID": fill_color,
      "IO": fill_color2,
      "IN": fill_color,
      "IA": fill_color1,
      "KS": fill_color2,
      "KY": fill_color1,
      "LA": fill_color,
      "ME": fill_color2,
      "MD": fill_color,
      "MA": fill_color1,
      "MI": fill_color2,
      "MN": fill_color1,
      "MS": fill_color,
      "MO": fill_color2,
      "MT": fill_color1,
      "NE": fill_color,
      "NV": fill_color2,
      "NH": fill_color1,
      "NJ": fill_color,
      "IL": fill_color2,
      "NM": fill_color,
      "NY": fill_color1,
      "NC": fill_color2,
      "ND": fill_color1,
      "OH": fill_color,
      "OK": fill_color2,
      "OR": fill_color,
      "PA": fill_color1,
      "RI": fill_color2,
      "SC": fill_color1,
      "SD": fill_color,
      "TN": fill_color1,
      "TX": fill_color,
      "UT": fill_color1,
      "VT": fill_color,
      "VA": fill_color1,
      "WA": fill_color,
      "WV": fill_color1,
      "WI": fill_color,
      "WY": fill_color1,      
    };
  };
  
  return (
    <>
    <head>
      <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha1/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-GLhlTQ8iRABdZLl6O3oVMWSktQOp6b7In1Zl3/Jr59b6EGGoI1aFkw7cmDA6j6gD" crossorigin="anonymous"/>
    </head>
    <div className='rectangle1'/>
    <div className='rectangle2'/>
    <div id="backgroundImages">
      <div id="website"  className="container-center-horizontal">
        <h1 id="title" style={{display:'inline-block'}}><strong>Meal <h1 id="titleBlue" style={{display:'inline-block'}}>Mapper</h1></strong></h1>
      </div>
        <div className="container-center-horizontal">
          <h2 id="description"> Select a state down below to view the food scarcity statistics</h2>
        </div>
      <div id="map">
        <USAMap
          onClick={(event) => handleClick(event.target.dataset.name)}
          customize={statesCustomConfig()}
        />
      </div>
    </div>
    {/*<h1 id = "gpt_result"></h1>*/}
    <Data id="theData" state={text} ></Data>
    </>
  );
}

export default App;
